B.a8C=new A.cb([B.io,"Esta categor\xeda busca garantizar que el sistema de transporte responda a las necesidades de todos los ciudadanos, con especial \xe9nfasis en la equidad de g\xe9nero y la inclusi\xf3n de personas en situaci\xf3n de vulnerabilidad. Se monitoriza mediante indicadores que permiten identificar barreras, riesgos y oportunidades de mejora en el entorno vial, tales como:\n\n          -\tReportes de acoso sexual por tipo: Permite conocer la frecuencia y caracter\xedsticas de incidentes de acoso, facilitando la implementaci\xf3n de medidas de prevenci\xf3n y protocolos de atenci\xf3n.\n          -\tMapeo de reportes de lugares percibidos como inseguros por tipo: Identifica \xe1reas cr\xedticas en el sistema de transporte, orientando intervenciones para mejorar la seguridad.\n          -\tMujeres empleadas en el sector transporte (n\xfamero y proporci\xf3n por nivel de empleo): Eval\xfaa la equidad laboral y la representatividad femenina en los distintos niveles del sector.\n          -\tAccesibilidad de estaciones, paraderos y veh\xedculos de TPU: A trav\xe9s del n\xfamero de estaciones y paraderos adaptados y la proporci\xf3n de veh\xedculos accesibles para personas con movilidad reducida, se mide el compromiso con una movilidad inclusiva.\n          -\tReportes de barreras de accesibilidad y discriminaci\xf3n en el TPU: Detecta obst\xe1culos y actitudes discriminatorias que impiden el acceso pleno al sistema, permitiendo acciones correctivas.\n          -\tN\xfamero de personas con carnet de discapacidad: Facilita el dise\xf1o de estrategias que respondan a las necesidades espec\xedficas de este grupo.\n",B.ip,"Esta categor\xeda se centra en la protecci\xf3n de todos los usuarios del sistema vial, minimizando riesgos y mejorando la respuesta ante incidentes. Se eval\xfaa mediante indicadores que permiten un an\xe1lisis desagregado por g\xe9nero, edad, tipo de usuario y caracter\xedsticas del siniestro:\n\n          -\tFatalidades y lesiones: Se registran por tipo de usuario vial, g\xe9nero, rango de edad, tipo de siniestro, y considerando el d\xeda y hora de ocurrencia, lo que permite identificar patrones y focalizar acciones de prevenci\xf3n.\n          -\tReportes de comportamientos riesgosos e incidentes viales: Se registran tanto en n\xfamero como en ubicaci\xf3n, permitiendo identificar zonas de alta incidencia y la gravedad de los eventos para implementar medidas correctivas en la v\xeda p\xfablica.\n",B.iq,"Orientada a fomentar una cultura de respeto y responsabilidad en el uso del sistema de transporte, esta categor\xeda recopila informaci\xf3n sobre el cumplimiento de normas y la aplicaci\xf3n de sanciones. Entre sus indicadores destacan:\n\n          -\tMultas de tr\xe1nsito y transporte: Registro del n\xfamero de multas impuestas, clasificadas por tipo, hora, d\xeda y estado de la sanci\xf3n, que sirve para evaluar la efectividad de la fiscalizaci\xf3n.\n          - Reportes de infracci\xf3n de norma: Permite identificar comportamientos contrarios a las regulaciones, lo que favorece el dise\xf1o de campa\xf1as de educaci\xf3n vial y la aplicaci\xf3n de medidas correctivas.\n",B.ir,"La categor\xeda de infraestructura eval\xfaa la calidad, cobertura y mantenimiento del entorno f\xedsico destinado a la movilidad urbana sostenible. Sus indicadores permiten conocer tanto la oferta como el estado de la infraestructura:\n\n          -\tReportes de fallas en infraestructura: Registro de incidencias seg\xfan el tipo de falla, lo que ayuda a priorizar acciones de reparaci\xf3n y mejora.\n          -\tInfraestructura para bicicletas y se\xf1alizaci\xf3n vial: Se mide en kil\xf3metros de infraestructura dedicada para bicicletas y v\xedas se\xf1alizadas, impulsando modos de transporte alternativos y seguros.\n          -\tCobertura y estado del sistema de TPU: Se eval\xfaa el porcentaje de poblaci\xf3n atendida, la proporci\xf3n de infraestructura en buen estado y el porcentaje intervenido mediante acciones de mantenimiento, asegurando un servicio confiable y eficiente.\n",B.is,"Enfocada en la reducci\xf3n del impacto ambiental y la optimizaci\xf3n de recursos, esta categor\xeda monitorea la modernizaci\xf3n y eficiencia energ\xe9tica del parque vehicular y la calidad del aire, a trav\xe9s de indicadores como:\n          \n          -\tTecnolog\xeda de operaci\xf3n en veh\xedculos de TPU y parque automotor: Permite conocer la cantidad de veh\xedculos seg\xfan la tecnolog\xeda utilizada, incluyendo la medici\xf3n de veh\xedculos obsoletos retirados y aquellos que no superan pruebas de emisiones.\n          -\tEmisiones contaminantes y calidad del aire: Se cuantifican las emisiones de CO\u2082 y otros contaminantes (PM10, PM2.5, CO, SO\u2082, NO\u2082 y O\u2083), junto con el \xedndice de calidad del aire, lo que favorece la planificaci\xf3n de medidas ambientales.\n          -\tSensibilizaci\xf3n ciudadana: El porcentaje de ciudadanos informados y sensibilizados respecto al aire limpio es fundamental para promover comportamientos responsables y el uso de tecnolog\xedas limpias.\n",B.it,"Esta categor\xeda eval\xfaa la percepci\xf3n y satisfacci\xf3n de los usuarios del sistema de transporte, permitiendo identificar oportunidades para mejorar la calidad del servicio y la seguridad en la experiencia de viaje. Entre los indicadores se incluyen:\n\n          -\tAbordajes diarios en TPU: Mide la demanda y uso del sistema, reflejando la confianza y aceptaci\xf3n de los usuarios.\n          -\tReportes de incidentes de calidad y seguridad: Se registran tanto fallas en los veh\xedculos como reportes de inseguridad (robos, asaltos, etc.), que permiten responder de manera oportuna a problemas operativos y de seguridad.\n          -\tOcupaci\xf3n y frecuencia de viajes: La medici\xf3n de la ocupaci\xf3n en veh\xedculos y paraderos, as\xed como el n\xfamero de viajes diarios desglosados por modo, g\xe9nero y motivo de viaje, proporciona informaci\xf3n clave para ajustar la oferta del servicio.\n          -\tSubsidios operativos: La proporci\xf3n de estos respecto a los costos de operaci\xf3n y mantenimiento ayuda a evaluar la sostenibilidad econ\xf3mica del sistema y su impacto en la calidad del servicio.\n"],t.wD)
